import React from 'react'
import logo from './logo.jpg'


function Navbartwo() {
    return (
        <Navbar bg="light" expand="lg">
            <Navbar.Brand href="#home">
                <img src={logo} alt='logo' style={{ width: 40 }} />{''} Picture Perfect
            </Navbar.Brand>
        </Navbar>

    )
}
